Color:
Ground color light brown (
Figs. 12b–d
). Head brown, eyes dark reddish-brown. Vertex yellowishbrown, a single darker, longitudinal line from top of head to vertex. Frons and clypeus dark brown, labium dark black. Clypeogenal area same color as frons, uniformly punctate. Antennae yellowish-brown. Pronotum pale yellow apically with pale yellow band spanning width, medial and lateral portions dark brown. Hemelytra: clavus with irregular darker blotches, both basally and distally. Corium with four irregular discontinuous longitudinal stripes. Dense transverse microsculpturing prominent over clavus and medial portion of corium. Scutellum short, unicolorous dark brown. Prenodal embolar area short, widened, lacking distinct pruinosity. Nodal furrow hardly distiguishable, very short. Post-nodal area wide, very short. Two restricted, discontinuous, infuscated areas along each embolium, the apical infuscation being wider (
Figs. 12c–d
). Membrane subhyaline, dark brown, unicolorous. Venter dark brown, distal portion of middle and hind legs, natatorial setae, and metatarsal claws darkened.

Lateral lobes of abdominal tergum IV comparatively narrow, rounded apically. Right lobe slightly broader and longer, with 11–12 long setae, left lobe shorter, with 12 long evenly spaced, apically placed setae. Prestrigilar flap of tergal segment V as in 
Figure 13e
. Strigil very small, disk-like, with few combs. Median lobe of sternite VII (
Figs. 13f
, 
14d
) short, broad, with two longer setae restricted sub-basally, apex pointed. Free lobe of tergite VIII (

Fig. 
13g

) broad, nearly quadrate with inner angle rounded. Inner angle with 19–23 short setae, of more or less uniform length. Pars stridens processus cleaner ridges of tergite VIII not examined. Male left paramere (
Figs. 15a–e
) short, shaft somewhat parallel-sided, apical portion curved with narrow, pointed tip (
Figs. 15a–d
). Paramere base broad, upper portion of base extending to middle portion of shaft. Lower portion of base broadly curved (
Figs. 15a–e
). Right paramere (
Figs. 15a–e
) long, curved inward, constricted at base, tip of paramere tapering to a point (
Figs. 15a–e
). Base of right paramere long, lower portion rounded, with about 42 plectral ribs spanning width (
Fig. 15f
). Aedeagus broad, as in 
Figures 15a–d
.
